'use client';

import { jsPDF } from 'jspdf';
interface Invoice {
  dealerName: string;
  email: string;
  location: string;
  invoiceNumber: string;
  date: string;
  time: string;
  baseAmount: number;
  discount: number;
  amount: number;
}
export default function DownloadButton({ invoice }: { invoice: Invoice  }) {
  const handleDownload = () => {
    const doc = new jsPDF();
    const logoBase64 =
      'data:image/jpeg;base64,'; // 🔁 Paste your base64 logo here

    // Header
    doc.addImage(logoBase64, 'PNG', 80, 10, 50, 15);
    doc.setFontSize(16);
    doc.text('INVOICE', 105, 30, { align: 'center' });
    doc.setFontSize(11);
    doc.line(20, 35, 190, 35); // underline

    // Dealer Info
    doc.text(`Dealer Name: ${invoice.dealerName}`, 20, 45);
    doc.text(`Dealer Email: ${invoice.email}`, 20, 52);
    doc.text(`Location: ${invoice.location}`, 20, 59);

    // Invoice Info
    doc.text(`Invoice ID: ${invoice.invoiceNumber}`, 140, 45);
    doc.text(`Date: ${invoice.date}`, 140, 52);
    doc.text(`Time: ${invoice.time}`, 140, 59);

    doc.line(20, 65, 190, 65); // underline

    // Table Heading
    doc.setFont('helvetica', 'bold');
    doc.text('Description', 20, 75);
    doc.text('Amount (₹)', 170, 75, { align: 'right' });
    doc.setFont('helvetica', 'normal');

    let y = 85;
    doc.text('Due Amount', 20, y);
    doc.text(`${invoice.baseAmount.toFixed(2)}`, 170, y, { align: 'right' });

    y += 10;
    const discountAmount = invoice.baseAmount * invoice.discount / 100;
    doc.text(`Discount ${invoice.discount}%`, 20, y);
    doc.text(`${discountAmount.toFixed(2)}`, 170, y, { align: 'right' });

    y += 10;
    const gstAmount = invoice.baseAmount * 0.18;
    doc.text('GST 18%', 20, y);
    doc.text(`${gstAmount.toFixed(2)}`, 170, y, { align: 'right' });

    y += 15;
    doc.setFont('helvetica', 'bold');
    doc.text('Total Paid', 20, y);
    doc.text(`₹ ${invoice.amount.toFixed(2)}`, 170, y, { align: 'right' });

    // Footer
    y += 20;
    doc.setFont('helvetica', 'normal');
    doc.setFontSize(10);
    doc.text('Thank you for your payment.', 105, y, { align: 'center' });

    doc.save(`invoice_${invoice.invoiceNumber}.pdf`);
  };

  return (
    <button
      onClick={handleDownload}
      className="mt-6 bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
    >
      Download Invoice
    </button>
  );
}
